import Card from "./card/Card";
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <AboutUs />
     {/* <div className="cards">   */}
      <Card />
      <Card />
      <Card />
      <Card />
      {/* </div> */}


      <Login />
      <Signup />
    </div>
  );
}

export default App;
